// @mui material components
// import Card from "@mui/material/Card";
// import Grid from "@mui/material/Grid";
// import {Link} from 'react-router-dom';
// Soft UI Dashboard PRO React components
// import SuiBox from "components/SuiBox";
import SuiTypography from "components/SuiTypography";

// Soft UI Dashboard PRO React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
import Footer from "examples/Footer";

import { Form , col} from 'react-bootstrap';


function Sidemenu() {
    return (
        <DashboardLayout>
            <DashboardNavbar />
            <SuiTypography variant="h2" fontWeight="medium" style={{ textAlign: 'center', color: 'red' }}>
                KAUSTUBH BHATTAD
            </SuiTypography>
            <br />
            <h3 style={{ color: '#1798A5' }} >Edit User Profile (User Id - 432847)</h3>
            <hr style={{ color: '#1798A5' }} />

            <h4><a href="/user/update/432847">Update User Settings</a></h4>

            <Form>
                <fieldset disabled>
                    <Form.Group className="mb-3">
                        <Form.Label htmlFor="disabledTextInput">BSE Client Id</Form.Label>
                        <Form.Control id="disabledTextInput" placeholder="K432847" />
                    </Form.Group>
                    <Form.Group className="mb-3">
                        <Form.Label htmlFor="disabledSelect">Tax Status</Form.Label>
                        <Form.Select id="disabledSelect">
                            <option>Individual</option>
                        </Form.Select>
                    </Form.Group>
                 
                 
                </fieldset>
            </Form>

            <Form>
                <fieldset disabled>
            
                    <Form.Group as={col} className="mb-3">
                        <Form.Label htmlFor="disabledSelect">Tax Status</Form.Label>
                        <Form.Select id="disabledSelect">
                            <option>Individual</option>
                        </Form.Select>
                    </Form.Group>
                 
                    <Form.Group as={col} className="mb-3">
                        <Form.Label htmlFor="disabledSelect">Tax Status</Form.Label>
                        <Form.Select id="disabledSelect">
                            <option>Individual</option>
                        </Form.Select>
                    </Form.Group>

                    <Form.Group as={col} className="mb-3">
                        <Form.Label htmlFor="disabledSelect">Tax Status</Form.Label>
                        <Form.Select id="disabledSelect">
                            <option>Individual</option>
                        </Form.Select>
                    </Form.Group>
                </fieldset>
            </Form>
            <Footer />
        </DashboardLayout>
    );
}

export default Sidemenu;
